import React from 'react';

const Navigation = () => {
	return (
		<nav>
		  <a onClick={() => onRouteChange('home')}>Home</a>
		  <a onClick={() => onRouteChange('skills')}>Skills</a>
		  <a onClick={() => onRouteChange('projects')}>Projects</a>
		  <a onClick={() => onRouteChange('contact')}>Contact</a>
		</nav>
	);
}


export default Navigation
